// Пример компонента CartPage
const CartPage = () => {
    const cart = useSelector(state => state.cart);  // Предположим, что корзина хранится в Redux
    
    return (
      <div>
        <h1>Корзина</h1>
        <ul>
          {cart.map(product => (
            <li key={product.id}>
              <img src={product.imageUrl} alt={product.name} />
              <h3>{product.name}</h3>
              <p>{product.price}</p>
              <button onClick={() => handleRemove(product.id)}>Удалить</button>
            </li>
          ))}
        </ul>
      </div>
    );
  };
